import React from 'react';

export default function withData(Component) {
    const speakers = [
        {
            imgSrc: 'speaker-component-1124.png',
            name: 'Douglas'
        },
        {
            imgSrc: 'speaker-component-1530.png',
            name: 'Tamara'
        },
        {
            imgSrc: 'speaker-component-10803.png',
            name: 'Eugene'
        }
    ];
    return function() {
        return <Component speakers={speakers}/>
    };
}
